import React from 'react';
import taskImg from '../imgs/task-img.png'

function Header(){

    return(

        <div className='header'>

            
            <div>
                <img className='task-img' src={taskImg}></img>
            </div>
            
            
           

        </div>

    );

}

export default Header;
